import React from 'react';
import {IonRow, IonButton} from '@ionic/react';
import ReactCodeInput from 'react-verification-code-input';

const TestController: React.FC<{
    onVerify: () => void;
    onType: () => void;
    }> = props => {
        
    return (
        <IonRow class="ion-justify-content-center" style={{marginTop:"10%"}}>
            <ReactCodeInput onComplete={props.onType}></ReactCodeInput>
            <IonButton size="large" id="doneBtn" type="submit" onClick={props.onVerify}>DONE</IonButton>
        </IonRow>
    );
}

export default TestController;
